import React from 'react'
import Card from '../components/Card'
import Button from '../components/Button'

const CardPage = () => {
  const cards = [
    {
      id: 1,
      title: 'Mountain View',
      description: 'Beautiful mountain landscape with clear blue sky.',
      image: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=400',
    },
    {
      id: 2,
      title: 'Ocean Waves',
      description: 'Peaceful ocean view with gentle waves.',
      image: 'https://images.unsplash.com/photo-1505142468610-359e7d316be0?w=400',
    },
    {
      id: 3,
      title: 'Forest Path',
      description: 'A serene path through the green forest.',
      image: 'https://images.unsplash.com/photo-1441974231531-c6227db76b6e?w=400',
    },
  ]

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold text-gray-800 mb-8">
        Card Component Gallery
      </h1>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mb-12">
        {cards.map((card) => (
          <Card
            key={card.id}
            title={card.title}
            description={card.description}
            image={card.image}
            footer={
              <Button primary size="small">
                View Details
              </Button>
            }
          />
        ))}
      </div>

      <div className="mb-8">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">
          Card Without Image
        </h2>
        <div className="max-w-md">
          <Card
            title="Simple Card"
            description="This is a card without an image. Perfect for text-based content."
          />
        </div>
      </div>
    </div>
  )
}

export default CardPage
